 expression by inhibiting nuclear factor-kappa B activation in mouse osteoblasts . Bone-forming osteoblasts have been recently reported capable of expressing the critical co-stimulatory molecule 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , as well as production of pro-inflammatory cytokines

 -  and IL - 1 , in the Porphyromonas gingivalis-lipopolysaccharide ( LPS ) - stimulated murine osteoblastic-like MC3T3 - E1 cells . Furthermore , inhibition of GSK - 3 remarkably represses the LPS-induced activation of the nuclear factor kappa B ( NF-B ) signaling pathway by suppressing IB phosphorylation , NF-Bp 65 nuclear translocation , and NF-Bp 65 DNA binding activity . Closer investigation by immunoprecipitation assay revealed that -catenin can physically interact with NF-Bp 65 . The negative regulation effect of GSK - 3 inhibitor on

 and production of pro-inflammatory cytokines in LPS-stimulated MC3T3 - E1 cells . Thus our results elucidate the molecular mechanisms whereby GSK - 3 inhibitor prevents the LPS-induced

<div class="entities" style="line-height: 2.5; direction: ltr">Ca2 + response of rat mesangial cells to DB00171 analogues . The aim of this investigation was to characterise the effects of DB00171 analogues and UTP on the single cell intracellular Ca2 + concentration ( [ Ca2 + ] i ) in cultured rat mesangial cells . Typically , there were two phases in the Ca2 + response to the agonists , an initial fast transient peak and a subsequent slower decline , or plateau , phase . For the peak amplitude in [ Ca2 + ] i the agonists had about equal effect . But when taking in consideration the percentage of responding cells and the integrated Ca2 + response over 1 min , the order of efficacy of nucleotide agonists ( 100 microM ) was UTP = DB00171 &gt; ATPgammaS &gt; ADP = 2MeS - DB00171 ( 2 - methylthio - DB00171 ) . DB00640 , AMP and beta , gamma-Me - DB00171 ( 100 microM ) had no effect .

<div class="entities" style="line-height: 2.5; direction: ltr">Acute erythropoietin cardioprotection is mediated by endothelial response . Increasing evidence indicates that high levels of serum erythropoietin ( Epo ) can lessen ischemia-reperfusion injury in the heart and multiple cardiac cell types have been suggested to play a role in this Epo effect . To clarify the mechanisms underlying this cardioprotection , we explored Epo treatment of coronary artery endothelial cells and Epo cardioprotection in a Mus musculus model with Epo receptor expression restricted to hematopoietic and endothelial cells ( EpoR ) . Epo stimulation of coronary artery endothelial cells upregulated endothelial nitric oxide synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) activity in vitro and in vivo , and enhanced nitric oxide ( NO ) production that was determined directly by real-time measurements of gaseous NO release . Epo stimulated phosphoinositide 3 - kinase ( PI3K ) / protein kinase B ( AKT ) and mitogen-activated protein kinase kinase ( MEK ) / extracellular signal regulated kinase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29323

</mark>
 ) signaling pathways , and inhibition of PI3K , but not MEK activity , blocked Epo-induced NO production . To verify the potential of this Epo effect in cardioprotection in vivo , EpoR-mice with Epo response in heart restricted to endothelium were treated with Epo . These mice exhibited a similar increase in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 phosphorylation in coronary artery endothelium as that found in wild type ( WT ) mice . In addition , in both WT - and EpoR-mice , exogenous Epo treatment prior to myocardial ischemia provided comparable protection . These data provide the first evidence that endothelial cell response to Epo is sufficient to achieve an acute cardioprotective effect . The immediate response of coronary artery endothelial cells to Epo stimulation by NO production may be a critical mechanism underlying this Epo cardioprotection .</div>

<h2 style="margin: 0">4</h2>

 abnormalities in identical twins with oligospermia . Clinical and biochemical studies . Identical twin brothers presented with oligospermia , small testes , normal male phenotypes , elevated serum luteinizing hormone levels , and normal or elevated serum testosterone levels . Both men had low to low-normal cytosol androgen receptor binding capacity in cultured fibroblasts from pubic skin biopsy specimens . Qualitative abnormalities of cellular androgen receptors were suggested by low-normal or low nuclear androgen uptake in fibroblasts from both brothers as well as abnormal thermolability and subnormal molybdate stabilization of androgen receptors from one brother . In vivo androgen sensitivity was assessed in one twin following administration of testosterone or the non-aromatizable androgen fluoxymesterone .

 suppressed serum luteinizing hormone and serum testosterone / estradiol-binding globulin , and although testosterone suppressed both serum luteinizing hormone and serum follicle-stimulating hormone , the suppression of serum luteinizing hormone by testosterone was subnormal . Both subjects showed marked exaggeration of the serum 17 - hydroxyprogesterone increase after administration of human chorionic gonadotropin , despite normal serum testosterone increases , suggesting a block in testicular 17,20- desmolase , which converts 17 - hydroxyprogesterone to testosterone . These studies suggest that oligospermia and block of the enzyme 17,20- desmolase may be the earliest manifestations of androgen resistance , and the finding of the syndrome of oligospermia , normal male phenotype , and androgen receptor abnormalities in identical twins indicates a genetic etiology of this disorder .</div>

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Pannexin 1 channels link chemoattractant receptor signaling to local excitation and global inhibition responses at the front and back of polarized neutrophils . Neutrophil chemotaxis requires excitatory signals at the front and inhibitory signals at the back of cells , which regulate cell migration in a chemotactic gradient field . We have previously shown that DB00171 release via pannexin 1 ( Q96RD7 ) channels and autocrine stimulation of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P41231
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptors contribute to the excitatory signals at the front . Here we show that Q96RD7 also contributes to the inhibitory signals at the back , namely by providing the ligand for A2A adenosine receptors . In resting neutrophils , we found that A2A receptors are uniformly distributed across the cell surface . In polarized cells , A2A receptors redistributed to the back where their stimulation triggered intracellular DB02527 accumulation and protein kinase A ( PKA ) activation , which blocked chemoattractant receptor signaling . Inhibition of Q96RD7 blocked A2A receptor stimulation and DB02527 accumulation in response to formyl peptide receptor stimulation . Treatments that blocked endogenous A2A receptor signaling impaired the polarization and migration of neutrophils in a chemotactic gradient field and resulted in enhanced 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29323
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and p38 MAPK signaling in response to formyl peptide receptor stimulation . These findings suggest that chemoattractant receptors require Q96RD7 to trigger excitatory and inhibitory signals that synergize to fine-tune chemotactic responses at the front and back of neutrophils . Q96RD7 channels thus link local excitatory signals to the global inhibitory signals that orchestrate chemotaxis of neutrophils in gradient fields .</div>

</mark>
 and Drosophila Zw3Sgg , but has no effect on other protein kinases . The effect of Li + on GSK - 3 is reversible in vitro . Treatment of cells with Li + inhibits GSK - 3 - dependent phosphorylation of the microtubule-associated protein Tau . Li + treatment of Drosophila S2 cells and rat PC12 cells induces accumulation of cytoplasmic Armadillo / beta-catenin , demonstrating that Li + can mimic Wingless signalling in intact cells , consistent with its inhibition of GSK - 3 . CONCLUSIONS : Li + acts as a specific inhibitor of the GSK - 3 family of protein kinases in vitro and in intact cells , and mimics Wingless signalling . This reveals a possible molecular mechanism of Li + action on development and differentiation .</div>
